from flask import Flask #importing flask libraries

app = Flask(__name__) #configuring app settings

@app.route('/') #main route
def main(): #what the browser does when it gets to the main route
	return("<html><a href='/hello'>Go to hello page</html>") #returns html page in the browser


@app.route('/hello') #hello route
def hello():
	return ("<html><p>Hello World!!!</p></html>")


if __name__ == '__main__': #running the app
	app.run(debug=True)


